const Index = ({stars}) => (
    <div>
        <h1>Next starts: {stars}</h1>
    </div>
);
// get intiial props runs first time on the server,
// and each consecutive time on the client
Index.getInitialProps = async (ctx) => {
    console.log("Get initial props")
};
export default Index
